import React from 'react'
import { useState } from "react";
import './numberingmachine.css'
import Pic1 from '../images/automaticNumberMachine/numberingMachine1.webp'
import Pic2 from '../images/automaticNumberMachine/numberingMachine2.webp'
import Pic3 from '../images/automaticNumberMachine/numberingMachine3.webp'
import Pic4 from '../images/automaticNumberMachine/numberingMachine1.webp'
import PageHeader from '../../Component/PageHeader/PageHeader'



export default function NumberingMachine() {

  const [show, setShow] = useState(false);

  const handleShow = () => setShow(true);
  const handleClose = () => setShow(false);


    const data = [
        { id: 1, title:"Product 1", description:"CAN BE USE FOR CONTINUE FORWARD COUNTING.", image : Pic1 },
        { id: 2, title:"Product 2", description:"CAN BE USE FOR REPEATING DIGITS.", image : Pic2},
        { id: 3, title:"Product 3", description:"INK WILL BE PROVIDED WITH MACHINE ", image : Pic3},
        { id: 4, title:"Product 4", description:"EASY TO USE", image : Pic4},

    ];
  return (
    <>
      <PageHeader topheading="Automatic Numbering" title="numberingmachine "/>
    
    <div className="container">
      <div className="cards-container">
         {data.map((item) => (
        <div key={item.id} className="card">
          <img src={item.image} alt={item.title} className="card-image" />
          <div className="card-content">
            <h3>{item.title}</h3>
            <p>{item.description}</p>
            <button className="card-button" >Details</button>
          </div>
         </div>
        ))}
      </div>
    </div>




    <div className="container text-center mt-5">
        <button className="btn btn-primary" onClick={handleShow}>Open Form</button>
      </div>
      {show && (
        <div className="modal-overlay">
          <div className="modal">
            <h2>Fill the Form</h2>
            <form className="form">
              <input type="text" placeholder="Your Name" required className="form-input" />
              <input type="email" placeholder="Your Email" required className="form-input" />
              <button type="submit" className="btn btn-success">Submit</button>
            </form>
            <button className="close-button" onClick={handleClose}>Close</button>
          </div>
        </div>
      )}

    </>
  )
}




